const Certificate = (props) => {
     const [passedcourse,setPassedCourse] = useState({});
     const UserData = useSelector((store: any) => store.auth.currentUser);
     const dispatch = useDispatch();
     const [certificate,setCertificate] = useState({});
     const history = useHistory();
    const isTabletOrMobile = useMediaQuery({ maxWidth: 750 })
    useEffect(()=>{
        getPassedCourseCertification();
    },[]);
    const getPassedCourseCertification = async () =>{
        let passedCourseId = props.match.params.id;
        await axios.get(baseurl + "/download_certification/" + passedCourseId)
            .then(function (response) {
                // handle success
                if(response.status === 200){
                    setPassedCourse(response.data.pass_courses);
                }
            })
            .catch(function (error) {
                history.goBack();
                if(error.response.status === 404){
                    dispatch(showAlert({
                        message:error.response.data.message,
                        messageType: 'error',
                        showAlertMessage: true
                    }));

                }


            })
            .then(function () {

            });
    }


     if(isTabletOrMobile){
        return ( <div>
            <PDFDownloadLink document={     <MyCertificate passedcourse={passedcourse} username={UserData}></MyCertificate>} fileName="somename.pdf">
                {({ blob, url, loading, error }) =>
                    loading ? 'Loading document...' :

                        <MBox justifyContent="center">
                         <MBox> <Button variant="contained" color="primary">
                             Download now!
                         </Button></MBox>
                        </MBox>

                }
            </PDFDownloadLink>
        </div>)
     }else{
         return (


             <PDFViewer width='100%' height='100%'>


                 <MyCertificate passedcourse={passedcourse} username={UserData}></MyCertificate>

             </PDFViewer>


         );
     }






}
export default Certificate;